// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.6;
// import '@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol';
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

// 0x289D2653846553C2594AE723430f9d9B407A11fA

interface IUniswapV2Router {
    function swapETHForExactTokens(
        uint256 amountOut,
        address[] calldata path,
        address to,
        uint256 deadline
    ) external payable returns (uint256[] memory amounts);

    function getAmountsOut(uint256 amountIn, address[] calldata path)
        external
        view
        returns (uint256[] memory amounts);

    function addLiquidity(
        address tokenA,
        address tokenB,
        uint256 amountADesired,
        uint256 amountBDesired,
        uint256 amountAMin,
        uint256 amountBMin,
        address to,
        uint256 deadline
    )
        external
        returns (
            uint256 amountA,
            uint256 amountB,
            uint256 liquidity
        );
}

contract Liquidity {
    address public UniswapV2Router02test =
        0xbdd4e5660839a088573191A9889A262c0Efc0983; //polygon
    address public DAI = 0xaf16A1077E997D70d52637054666b8149c5ca348; // polygon mainnet
    address public WMATIC = 0x3d5ee42e72aCBe5334319Fa0dD38a8F7d420Fff9; // polygon mainnet
    address public mine = 0x5985A4afAEdE9bEfd5350cf67Fa3CFcE581Bc2D8;

    constructor() {}

    IUniswapV2Router uniswapRouterTest =
        IUniswapV2Router(UniswapV2Router02test);

    function run() external payable {
        uint256 amountA = 20;
        uint256 amountB = 30;

        IERC20(WMATIC).transferFrom(msg.sender, address(this), amountA);
        IERC20(DAI).transferFrom(msg.sender, address(this), amountB);

        IERC20(WMATIC).approve(UniswapV2Router02test, amountA);
        IERC20(DAI).approve(UniswapV2Router02test, amountB);

        uint256 deadline = block.timestamp;

        uniswapRouterTest.addLiquidity(
            WMATIC,
            DAI,
            amountA,
            amountB,
            1,
            1,
            address(this),
            deadline
        );
    }
}
